syntax = "proto3";

option go_package = "github.com/channel-io/ch-proto/call_dw";
option java_multiple_files = true;

package call_dw;

service CallDw {
  rpc FindCallSetting(ChannelId) returns (CallSetting) {
  }
}

message ChannelId {
  string value = 1;
}

message CallSetting {
  string channelId = 1;
}
